import classes from "./Header.module.scss";
import typography from "./extras/typography.module.scss";
import heroImage from "../assets/images/hero-background.svg";

const Header = () => {
  return (
    <header className={classes.header}>
      <article className={classes["header__text-box"]}>
        <h1 className={typography["heading__primary"]}></h1>
      </article>
      <img src={heroImage} alt="Image of hero section"></img>
    </header>
  );
};

export default Header;
